import React from "react";
import { Container, Box, Text } from "@chakra-ui/react";

export default function HomePage() {
  return (
    <Container maxW="x1 centerContent">
      <Box d="flex" justifyContent="center" p={3} bg={"white"} w="100%" m="40px 0 15px 0 "
      borderRadius="lg" borderWidth="1px">
        <Text fontSize='4x1' fontFamily="Work sans" color={"blue"}>Talk-A-Tive</Text>
      </Box>
      <Box bg="white" w="100%" p-={4}></Box>
    </Container>
  );
}
